import React, { useState } from "react";
import Form from "./Form";
import Result from "./Result";

function App() {
  const [result, setResult] = useState(null);
  const [error, setError] = useState("");

  return (
    <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-indigo-100 via-indigo-200 to-indigo-300">
      <div className="w-full max-w-xl bg-white shadow-2xl rounded-2xl p-8">
        <Form setResult={setResult} setError={setError} />
        <Result result={result} error={error} />
      </div>
    </div>
  );
}

export default App;
